 the allied bombs in Rome during the second World War; they travel to the remote village where Cesira was born. During their journey and in the village and onward, the mother does everything she can to protect Rosetta. Meanwhile, a sensitive young intellectual, Michele, falls in love with Cesira.','','',8,'12,25',0,'https://flashington.sgp1.digitaloceanspaces.com/uploads/videos/SV-2019-04-20-18-06-56-c78be53ed707ca3f78a48139561786eca9b80f4f.mp4','','','','https://www.flashington.com/uploads/images/SV-2019-04-20-18-07-51-211eb4575f16bddcae8619e6685e49acfbf21d64.jpg','https://www.flashington.com/uploads/gifs/video_117.gif','','','3','','1',1,0,0,'admin','2019-04-20 23:06:55','01:40:00','00:00:00','',NULL,6,6,6,'','','admin','',0,0,0,1,0,0.00,0.00,0.00,'2019-04-20 10:07:51','2019-04-20 10:07:52',3,0,0,6,2,'[1291,1292,1293,1294,1295,1296,1297,1298,1299,1300,1301,1302,1303]','[1304]','[1305,1306,1307]','0',1,'1960-12-23','[{\"iso_3166_1\":\"GR\",\"title\":\"Η Ατιμασμένη\",\"type\":\"\"},{\"iso_3166_1\":\"US\",\"title\":\"Two Women\",\"type\":\"\"},{\"iso_3166_1\":\"ES\",\"title\":\"Dos mujeres\",\"type\":\"\"},{\"iso_3166_1\":\"CN\",\"title\":\"两个女人\",\"type\":\"\"},{\"iso_3166_1\":\"CN\",\"title\":\"战地两女性\",\"type\":\"\"},{\"iso_31'),(118,'tamango5cbb604039b4c','Tamango','John Reinke, the Dutch captain of a slave ship, is carrying a live cargo of slaves from Africa to Cuba in the 1800s. He has his mistress and servant-slave, Aiche, , on the ship, and the ships doctor, Corot, has his eye on Aiche. The slaves, under the leadership of warrior Tamango, plot a revolt, the moment they are herded on board. Corot convinces Aiche that Reinke never intends to marry her or set her free, and is going to marry a Dutch girl. Aiche joins with Tamango in the revolt. When the situation becomes a stalemate, Reinke orders a cannon fired into the hold of the ship, where the blacks are barricaded with stolen arms.','','',8,'16,12',0,'https://flashington.sgp1.digitaloceanspaces.com/uploads/v