lyn\",\"type\":\"TV\"}]'),(120,'the-day-the-fish-came-out5cbb6140a704d','The Day the Fish Came Out','A plane carrying a weapon more dangerous than a nuclear weapon goes down near Greece. To prevent panic, the officials go in dressed as tourists (who are dressed so casually that the pilots assume that they are all gay). The pilots are not to make themselves known and can\'t contact the rescue team. The secrecy causes a comedy of errors including the desolate Greek Isle deciding that since tourists have now arrived, they have to become touristy.','','',8,'32,9',0,'https://flashington.sgp1.digitaloceanspaces.com/uploads/videos/SV-2019-04-20-18-13-21-71fe30fb87f80c2b3da650fbe9aa8b7741a3ec18.mp4','','','','https://www.flashington.com/uploads/images/SV-2019-04-20-18-14-49-6dc18c5f734b1235a167a1d9243022ec0ef65993.jpg','https://www.flashington.com/uploads/gifs/video_120.gif','','','2','','1',1,0,0,'admin','2019-04-20 23:13:20','01:49:00','00:00:00','',NULL,6,6,6,'','','admin','',0,0,0,1,0,0.00,0.00,0.00,'2019-04-20 10:14:48','2019-04-20 10:14:49',3,0,0,6,2,'[1335,1336,1337,1338,1339,1340]','[1341,1342,1343]','[1344]','0',1,'1967-09-27','[{\"iso_3166_1\":\"GR\",\"title\":\"...Otan ta psaria vgikan sti steria!\",\"type\":\"translit\"}]'),(121,'olgas-girls5cbb6480b14b0','Olga\'s Girls','A vicious underworld leader brings the pain for her female underlings in this celebrated sexploitation \"roughie,\" a sequel to White Slaves of Chinatown. Olga (Audrey Campbell) is a woman who, working with \"the Syndicate\" (a criminal network that encompasses the local mafia and several Russian and Chinese communist operatives), oversees a stable of women who do double duty as prostitutes and drug pushers. Olga is a cruel woman who will tolerate no misbehavior among her charges (many of whom are addicted to \"the Big H\" and work for her to feed their habits), and subjects them to periodic torture sessions when she feels they aren\'t living up to her expectations. When Olga discovers that one