day\": Two girls pick up clients by driving around in a car...','','',8,'9,12',0,'https://flashington.sgp1.digitaloceanspaces.com/uploads/videos/SV-2019-04-20-18-41-37-963be203fab9df4cd98f3bfd9caee255145479c5.mp4','','https://youtu.be/ZB31QsrwZxk','','https://www.flashington.com/uploads/images/SV-2019-04-20-18-42-42-64746c9672ea1f5bbe27cd506cc07c31dd0a8c87.jpg','https://www.flashington.com/uploads/gifs/video_127.gif','','','2','','1',1,0,0,'admin','2019-04-20 23:41:37','01:59:00','00:00:00','',NULL,6,6,6,'','','admin','',0,0,0,1,0,0.00,0.00,0.00,'2019-04-20 10:42:42','2019-04-20 10:42:43',3,0,0,7,2,'[1437,1438,762,1439,1440,1441,1442,414,1443,1444,1445,1446,990,1447,1448]','[1449,1450,1078,1451,1452,1453]','[1454,1455,1456,1457,1458,1459]','0',1,'1967-04-05','[{\"iso_3166_1\":\"ZA\",\"title\":\"The Oldest Profession in the World\",\"type\":\"\"}]'),(128,'bebos-girl5cbb69ac880c3','Bebo\'s Girl','Screenplay by Comencini, Marcello Fondato, based on a novel by Carlo Cassola. With George Chakiris, Claudia Cardinale, Marc Michel, Dany Paris. At the end of World War II, shallow, self-centered Mara (Cardinale) is the prettiest girl in her small Italian village; Bebo (Chakiris) is a Communist partisan who is finding it difficult to adjust to the dull banalities of life in peacetime. When Mara’s father, a passionate Communist, declares that his daughter will marry the returning hero, her reactions range from joy to bitter resentment, as director Comencini—one of the greats of Italian comedy, here deftly turning his hand to drama—traces her development from a flighty adolescent into a mature woman. Though dubbed in Italian, Chakiris creates a stirring portrayal though posture and movement as the dazzling but deeply flawed Bebo, who seems to lose his heroic dimensions as Mara’s grow.','','',8,'12',0,'https://flashington.sgp1.digitaloceanspaces.com/uploads/videos/SV-2019-04-20-18-49-17-7c1e49b64b10682d67e7e952c2eac0a343011822.mp4','','','','https://www.flashington.com/uploads/im