INSERT INTO `email_templates` VALUES (1,'user_welcome','Welcome to <%site_name%>','Thanks for signing up! We\'re very excited to have you on board.',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(2,'admin_user_welcome','Welcome to <%site_name%>','Thanks for signing up! Where very excited to have you on board.',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(3,'forgot_password','Your new password','Your Forgot Password request has been Accepted. Please find your credentials of <%site_name%>, <br> Email : <%email%> <br> Password : <%password%>',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(4,'moderator_welcome','Welcome to <%site_name%>','Congratulations! Admin has made you a Content Creator. Please use the link and details below to login and upload Content.<br> Please find your credentials of <%site_name%>,  <br> Email : <%email%> <br> Password : <%password%>',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(5,'payment_expired','Payment Notification','Your notification has expired. To keep using channel creation  & upload video without interruption, subscribe any one of our plans and continue to upload',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(6,'payment_going_to_expiry','Payment Notification','Your subscription will expire soon. Our records indicate that no payment method has been associated with this subscripton account. Go to the subscription plans and provide the required payment information to renew your subscription for watching videos and continue using your profile uninterrupted.',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(7,'new_video','\'<%video_name%>\' in <%site_name%>','\'<%video_name%>\' video uploaded in \'<%category_name%>\' Category, don\'t miss the video from <%site_name%>',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(8,'edit_video','\'<%video_name%>\' in <%site_name%>','\'<%video_name%>\' video uploaded in \'<%category_name%>\' Category, don\'t miss the video from <%site_name%>',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(9,'automatic_renewal','Automatic Renewal Notification','Your subscription is renewed automatically.',1,'2018-12-18 08:24:44','2018-12-18 08:24:44'),(10,'moderator_update_mail','Email Change Notification','You receive this one at your old email address. Please note that this email is a security measure to protect your account in case someone is trying to take it over.  <br> <b> Your New Email Address is : <%email%> </b>',1,'2018-12-18 08:24:44','2018-12-18 08:24:44');
