INSERT INTO `pages` VALUES (1,'About Flashington','<p>FLASHINGTON is a collective of streaming channels designed with &nbsp;the purpose of living up to the definition of the term. If movies and TV shows that are lively, bold, spicy, a little feisty and full of spirit are what you seek for entertainment, this is the subscription service for you. &nbsp;</p>\r\n\r\n<p>DISCOVER rare, uncut, uncensored, politically incorrect, with no ads and unique offbeat content created specifically to lure customers into theaters.</p>\r\n\r\n<p>BINGE on fresh titles uploaded each and every week. &nbsp;</p>\r\n\r\n<p>STREAM anytime, anywhere and on any device with nothing to download. A buffet of bodacious and scintillating cinema is now just a click away.</p>','about','2018-12-18 08:24:43','2019-09-19 10:09:05'),(2,'contact','<p>A page to contact us&nbsp;... will fill in later.</p>','contact','2018-12-18 08:24:43','2019-09-10 10:39:31'),(3,'privacy','<p>A page for Privacy info ... will fill in later.</p>','privacy','2018-12-18 08:24:43','2019-09-10 10:40:05'),(4,'terms','<p>A page for Terms and Conditions ... will fill in later.</p>','terms','2018-12-18 08:24:43','2019-09-10 10:40:31'),(5,'help','<p>A page for Help or FAQS ... will fill in later.</p>','help','2018-12-18 08:24:43','2019-09-10 10:41:02');
