INSERT INTO `sub_categories` VALUES (5,8,'Action','Action film is a film genre in which the protagonist or protagonists are thrust into a series of challenges that typically include violence, extended fighting, physical feats, and frantic chases.','',1,0,'2019-03-28 07:46:26','2019-03-28 08:11:17'),(6,8,'Adventure','Adventure films are a genre of film that typically use their action scenes to display and explore exotic locations in an energetic way.','',1,0,'2019-03-28 08:12:15','2019-03-28 08:12:15'),(7,8,'Bad Girls','Bad Girls films are a film genre where the main actresses are bad ass girls: in prison, war or crime sequences such as fighting, stunts, car chases or explosions.','',1,0,'2019-03-28 08:18:06','2019-03-28 08:18:06'),(8,8,'Biography','A film that dramatizes the life of a non-fictional or historically-based person or people.','',1,0,'2019-03-28 08:20:25','2019-03-28 08:20:25'),(9,8,'Comedy','Comedy is a genre of film in which the main emphasis is on humour.','',1,0,'2019-03-28 08:21:26','2019-03-28 08:21:26'),(10,8,'Crime','Crime films are a cinematic genre inspired by and analogous to the crime fiction literary genre.','',1,0,'2019-03-28 08:23:11','2019-03-28 08:23:11'),(11,8,'Documentary','A documentary film is a nonfictional motion picture intended to document some aspect of reality, primarily for the purposes of instruction, education, or maintaining a historical record.','',1,0,'2019-03-28 08:25:03','2019-03-28 08:25:03'),(12,8,'Drama','Drama is a genre of narrative fiction (or semi-fiction) intended to be more serious than humorous in tone.','',1,0,'2019-03-28 08:26:23','2019-03-28 08:26:23'),(13,8,'Erotica','Erotica is any artistic work that deals substantively with subject matter that is erotically stimulating or sexually arousing but is not pornographic.','',1,0,'2019-03-28 08:30:08','2019-03-28 08:30:08'),(14,8,'Fantasy','Fantasy films are films that belong to the fantasy genre with fantastic themes, usually magic, supernatural events, mythology, folklore, or exotic fantasy worlds.','',1,0,'2019-03-28 08:31:08','2019-03-28 08:31:08'),(15,8,'Film Noir','Film noir is a cinematic term used primarily to describe stylish Hollywood crime dramas, particularly those that emphasize cynical attitudes and sexual motivations.','',1,0,'2019-03-28 08:33:15','2019-03-28 08:33:15'),(16,8,'History','The historical period drama is a film genre in which stories are based upon historical events and famous people.','',1,0,'2019-03-28 08:34:08','2019-03-28 08:34:08'),(17,8,'Horror','A horror film is a film that seeks to elicit fear. ... Horror may also overlap with the fantasy, supernatural fiction, and thriller genres. Horror films often aim to evoke viewers\' nightmares, fears, revulsions and terror of the unknown.','',1,0,'2019-03-28 08:35:12','2019-03-28 08:35:12'),(18,8,'Mondo','A mondo film (from the Italian word for \"world\") is an exploitation documentary film, sometimes resembling a pseudo-documentary and usually depicting sensational topics, scenes, or situations.','',1,0,'2019-03-28 08:36:15','2019-03-28 08:36:15'),(19,8,'Musical','Musical film is a film genre in which songs sung by the characters are interwoven into the narrative, sometimes accompanied by dancing.','',1,0,'2019-03-28 08:37:23','2019-03-28 08:37:23'),(20,8,'Mystery','A mystery film is a genre of film that revolves around the solution of a problem or a crime. It focuses on the efforts of the detective, private investigator or amateur sleuth to solve the mysterious circumstances.','',1,0,'2019-03-28 08:38:48','2019-03-28 08:38:48'),(21,8,'Romance','Romance films that focus on passion, emotion, and the affectionate romantic involvement of the main characters and the journey that their genuinely strong, true and pure romantic love takes them through dating, courtship or marriage.','',1,0,'2019-03-28 08:40:52','2019-03-28 08:40:52'),(22,8,'Sci-Fi','Science fiction film is a genre that uses speculative, fictional science-based depictions of phenomena that are not fully accepted by mainstream science, such as extraterrestrial lifeforms, alien worlds, extrasensory perception and time travel.','',1,0,'2019-03-28 08:43:04','2019-03-28 08:43:04'),(23,8,'Sexploitation','A sexploitation film is a class of independently produced, low-budget feature film that is generally associated with the 1960s, and that serves largely as a vehicle for the exhibition of non-explicit sexual situations and gratuitous nudity. ','',1,0,'2019-03-28 08:44:59','2019-03-28 08:44:59'),(24,8,'Thriller','Thriller is a broad genre of literature, film and television, having numerous, often overlapping subgenres.','',1,0,'2019-03-28 08:45:53','2019-03-28 08:45:53'),(25,8,'War','War film is a film genre concerned with warfare, typically about naval, air, or land battles, with combat scenes central to the drama. It has been strongly associated with the 20th century.','',1,0,'2019-03-28 08:47:25','2019-03-28 08:47:25'),(26,8,'Western','Western is a genre of various arts which tell stories set primarily in the latter half of the 19th century in the American Old West, often centering on the life of a nomadic cowboy or gunfighter armed with a revolver and a rifle who rides a horse.','',1,0,'2019-03-28 08:48:26','2019-03-28 08:48:26'),(27,9,'Official Video','The official music video from the Artists','',1,0,'2019-03-28 09:15:19','2019-03-28 09:15:19'),(28,9,'Sports','Music videos featuring sports.','',1,0,'2019-03-28 09:29:17','2019-03-28 09:29:17'),(29,10,'Comedy Music','Comedy reality TV Show starring Kity G','',1,0,'2019-04-11 05:57:54','2019-04-11 05:57:54'),(30,8,'Music','','1',1,0,NULL,NULL),(31,8,'TV Movie','','1',1,0,NULL,NULL),(32,8,'Science Fiction','','1',1,0,NULL,NULL),(33,8,'Animation','','1',1,0,NULL,NULL);
